{
  "$schema": "https://turbo.build/schema.json",
  "extends": [
    "//"
  ],
  "tasks": {
    "build:js": {
      "cache": false,
      "inputs": [
        "package.json",
        "src/**",
        "tamagui-build.js"
      ],
      "outputs": [
        "dist/**"
      ]
    },
    "build": {
      "dependsOn": [
        "^build"
      ],
      "inputs": [
        "tsconfig.json",
        "package.json",
        "src/**",
        "tamagui-build.js",
        "externalNodePlugin.js"
      ],
      "outputs": [
        ".next/**",
        "dist/**",
        "types/**"
      ]
    },
    "start": {
      "dependsOn": [
        "^build"
      ],
      "outputs": []
    },
    "test": {
      "dependsOn": [
        "^build:js"
      ],
      "outputs": []
    },
    "clean": {
      "outputs": [
        "dist/**"
      ],
      "cache": false
    },
    "clean:build": {
      "outputs": [],
      "cache": false
    },
    "lint": {
      "cache": false,
      "outputs": []
    },
    "lint:fix": {
      "cache": false,
      "outputs": [
        "src/**"
      ]
    },
    "dev": {
      "cache": false
    }
  }
}
